  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Shiawasee
  National Wildlife Refuge outlines Refuge accomplishments during the 1975 fiscal
  year. The report begins by summarizing the weather conditions and habitat conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, mammals, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, collections and receipts, and vegetation control. Resource management
  is outlined; topics include fur harvesting. The public relations section of the
  report describes recreational uses, Refuge participation, hunting, violations, and
  safety.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
